window.bookSummaryJSON = "<p><b>One king is dead, and the other is in chains.</b></p> <p>Tir n’Aill perches on the edge of a knife in the wake of a series of betrayals that has shaken the fae to the core.</p> <p>Abigail finds herself questioning who is friend and who is foe. When she is forced to make her decision between mercy and love, she finds her choice is one that might tear the very world apart.</p> <p>Forces gather to wage war and decide the fate of Tir n’Aill. In the center of it all, Abigail is nearly torn in two, caught between her desire to protect her new people and her love for Valroy.</p> <p>For he is now the Unseelie King. The world is his to burn.</p> <p>And only she can stop him.</p>"; 
